import React from 'react';
import About from '../../About';
import {homeObjFour, homeObjOne, homeObjThree, homeObjTwo} from './Data';

function Home() {
    return (
        <>
            <About {...homeObjOne} />
            <About {...homeObjThree} />
            <About {...homeObjTwo} />
            <Pricing/>
            <About {...homeObjFour} />

        </>
    );
}

export default Home;
